// Filename - Main.jsx
import React from "react";
import objects from "../main-objects"

export default function Main() {
	const objElements = objects.map(object => <img key={object.id} src={`../images/${object.url}`} />)

    return (
		<div className="main">
			{objElements}
		</div>
    )
}
